-- ----------------------------
-- Procedure structure for `proc_FruitCount`
-- ----------------------------
DROP PROCEDURE IF EXISTS `proc_FruitCount`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_FruitCount`()
begin

declare v_begin varchar(1000) default ' SELECT IFNULL(groups,\'同一水果总销售额\') as groups ';

declare v_append varchar(1000) default ' from (select groups,IFNULL(code,\'totalSales\') as code ,sum(A.sales) as sales
from (
select m.groups as groups ,s.code as code,m.sales as sales
from t_supermarket  m inner join t_fruit s on m.fruit = s.id
) A
group by groups,
code with rollup having groups is not null
) B
group by groups
with rollup';

declare v_temp varchar(2000);

declare v_fruit varchar(100);

declare stop int default 0;

declare cur cursor for select code from t_fruit;

declare continue handler for not found set stop = 1; 

OPEN cur;
FETCH cur INTO v_fruit;
WHILE stop = 0 
DO
if v_temp = '' then
set v_temp = CONCAT(v_begin,'sum(if(code =\'',v_fruit,'\'');
set v_begin = CONCAT(v_temp,',sales,0)) as ',v_fruit);
else
set v_temp  = '';
set v_temp = CONCAT(v_begin,',','sum(if(code =\'',v_fruit,'\'','');
set v_begin = CONCAT(v_temp,',sales,0)) as ',v_fruit);
end if;
FETCH cur INTO v_fruit;
END WHILE;
CLOSE cur; 
set @v_result = CONCAT(v_begin,', sum(if(code=\'totalSales\',sales,0)) as \'totalSales\'');
set @v_result = CONCAT(@v_result,v_append);

prepare stmt from @v_result;
EXECUTE stmt ;
deallocate prepare stmt;
end
;;
DELIMITER ;

